  constructor(props) {
    super(props);
  }

  registerUser = async (e)=>{
    e.preventDefault
  }

  render() {  
    return (
        <section>
        <div className="conatiner">
        <div className="user signupBx">
          <div className="imgBx">
            <img src={key} alt="Heart Image" />
          </div>
          <div className="formBx">
            <form >
              <h2>Create an account</h2>
